import React from 'react';

class MachineWorkTable extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div id="mainComponent">
                <div className="row upperTable">
                    <div className="col-sm-3">
                        <div className="form-check">
                            <input type="radio" className="form-check-input" id="materialUnchecked" name="materialExampleRadios" />
                            <label className="form-check-label" for="materialUnchecked">Material unchecked</label>
                        </div>

                        <div className="form-check">
                            <input type="radio" className="form-check-input" id="materialChecked" name="materialExampleRadios" checked />
                            <label className="form-check-label" for="materialChecked">Material checked</label>
                        </div>                        
                    </div>
                    <div className="col-sm-3"></div>
                    <div className="col-sm-6"></div>
                </div>
                <div id="midTable"></div>
                <div id="lowerTable"></div>
            </div>
        );
    }
}

export default MachineWorkTable;
